import { Col } from "react-bootstrap"
import TopMovieCard from "../TopMovieCard/TopMovieCard"


const TopMovieList = ({ movieData, moviesFetch, handleNextPage }) => {


    return (
        movieData.map(elm => {
            return (
                <>
                    <Col md={{ span: 3 }} key={elm.id}>
                        <TopMovieCard className="movies" movie={elm} moviesFetch={moviesFetch} handleNextPage={handleNextPage} />
                    </Col>
                    <button onClick={handleNextPage}>Load More</button>
                </>
            )
        })
    )
}

export default TopMovieList
